import React from "react";
import "./style.css";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
      <a id="nav-item" className="navbar-brand" href="/">
        Search
      </a>
      <a id="nav-item" className="navbar-brand" href="/saved">
        Saved
      </a>
    </nav>
  );
}

export default Nav;
